const PARSE_CHUNK = 500;
function parse(classPaths, counter, classList, typeRoot) {
    const context = parseClasses(classPaths, classList.filter(it => !it.startsWith("kotlin.")));
    if (context === null)
        return false;
    const interfaces = context
        .classOrInterface()
        .map(it => it.interfaceDeclaration())
        .filter(it => it);
    for (const it of interfaces) {
        const className = qualifiedName(it.type());
        const count = it
            .interfaceBody()
            .interfaceMember()
            .filter(it => it.methodDeclaration()).length;
        if (it.typeList()) {
            counter[className] = [
                count,
                ...it
                    .typeList()
                    .type()
                    .map(it => qualifiedName(it)),
            ];
        }
        else {
            counter[className] = [count];
        }
    }
    if (typeRoot) {
        return generateTsDef(context, counter, typeRoot);
    }
    else {
        return true;
    }
}
function parseClasses(classPaths, classList) {
    const buffer = [];
    for (let i = 0; i < classList.length; i += PARSE_CHUNK) {
        const output = javap(classPaths, classList.slice(i, i + PARSE_CHUNK));
        if (output === null) {
            return null;
        }
        else {
            buffer.push(output);
        }
    }
    const input = buffer.join("\n");
    const lexer = new JavapLexer(new antlr4.InputStream(input));
    const tokens = new antlr4.CommonTokenStream(lexer);
    const parser = new JavapParser(tokens);
    return parser.compilationUnit();
}

